  { prop: 'directors', label: '导演', width: 150 },
  { prop: 'casts', label: '主演', width: 150 },
  { prop: 'year', label: '年份' },
  { prop: 'recommend', label: '推荐', noRepeat: true },
  {
    prop: 'remark',
    label: '备注',
    noRepeat: true,
    width: 200,
  },
]

export const a = 1
